#include <string>
#include <iostream>

using namespace std;

bool isVowel(char c)
{
    return (c == 'a' || c == 'e' || c == 'i' || c == 'o' || c == 'u');
}

/*
Runtime: O(n)

Explanation: We maintain window of k at all times. As we move window by 1 char, instead of counting each letter multiple times, 
we just see if letter we remove from our window was a vowel, and if letter we added to window was a vowel and change vowel account 
accordingly. Returns max number of vowels counted in a window k chars long
*/

int maxVowels(string s, int k)
{
    int vowels = 0;
    //count vowels in substring [0, k)
    for(int i = 0; i < k; i++)
    {
        if(isVowel(s[i])){ vowels++; }
    }
    int max = vowels;
    for(int i = 1; i <= s.length()-k; i++)
    {
        if(isVowel(s[i-1])){ --vowels; } //if letter we 'lost' was vowel, decrement vowel count
        if(isVowel(s[i+k-1])) { ++vowels; } //if new letter in our window is vowel, incrememnt vowel count
        vowels > max ? max = vowels : max; 
    }
    return max;
}

int main(int argc, char const *argv[])
{
    cout << "Solution is: " << maxVowels("", 50436) << endl;
    return 0;
}